const Landing = () => {
  const handleStart = () => {};
  return (
    <div>
      <div>
        <h1>Interactive 3D Model Viewer</h1>
        <p>Welcome to our 3D model viewer. Click the button to start.</p>
        <button onClick={handleStart}>Start</button>
      </div>
    </div>
  );
};

export default Landing;
